import Expenseitem from "../Expenses/Expenseitem";
import ExpenseFilter from "../ExpenseFilter/ExpenseFilter";
import { useState } from "react";

const ExpenseTask = (props) => {
 const [FilteredYear, setFilteredYear] = useState('2020');
 const  filterCall = (year)=>{
 setFilteredYear(year);
 }
  return ( 
    <div>
      <ExpenseFilter selected={FilteredYear} filterMethod={filterCall}/>
      {
        props.Expdetails.map(expense=> <Expenseitem thatDay={expense.thatDay} title={expense.tit}/>)
      }
      <Expenseitem thatDay={props.Expdetails[0].thatDay} title={props.Expdetails[0].title} rate={props.Expdetails[0].rate} />
      <Expenseitem thatDay={props.Expdetails[1].thatDay} title={props.Expdetails[1].title} rate={props.Expdetails[1].rate}/>
      <Expenseitem thatDay={props.Expdetails[2].thatDay} title={props.Expdetails[2].title} rate={props.Expdetails[2].rate}/>
      <Expenseitem thatDay={props.Expdetails[3].thatDay} title={props.Expdetails[3].title} rate={props.Expdetails[3].rate}/>
      <Expenseitem thatDay={props.Expdetails[4].thatDay} title={props.Expdetails[4].title} rate={props.Expdetails[4].rate}/>
    </div>
   );
}
 
export default ExpenseTask;
